import React, { useContext, useState } from 'react';
import { CartContext } from '../context/CartContext'; // Corrected import path
import jsPDF from 'jspdf';
import 'jspdf-autotable';
import QRCode from 'qrcode.react';
import './Invoice.css';

const Invoice = () => {
  const { cart } = useContext(CartContext);
  const [showQR, setShowQR] = useState(false); // State to toggle QR code display

  const totalAmount = cart.reduce((total, item) => total + item.price * item.quantity, 0);

  const handleDownloadPDF = () => {
    const doc = new jsPDF();

    // Add shop details
    doc.setFontSize(18);
    doc.text('Velavan Super Stores', doc.internal.pageSize.getWidth() / 2, 22, { align: 'center' });
    doc.setFontSize(12);
    doc.text('Phone: 9047665999', 14, 30);
    doc.text('Email: velavansuperstores@gmail.com', 14, 36);
    doc.text('GST No: 22AAXFV7324B1Z0', 14, 42);
    doc.text('Location: Bhavani main road, Salangapalayam, Tamil Nadu-638455', 14, 48);

    // Add date and time
    const date = new Date();
    const dateString = date.toLocaleDateString();
    const timeString = date.toLocaleTimeString();
    doc.text(`Date: ${dateString}`, doc.internal.pageSize.getWidth() - 14, 30, { align: 'right' });
    doc.text(`Time: ${timeString}`, doc.internal.pageSize.getWidth() - 14, 36, { align: 'right' });

    // Add a line break
    doc.line(14, 50, 200, 50);

    // Add table
    const tableColumn = ['Product', 'Price', 'Quantity', 'Total'];
    const tableRows = [];

    cart.forEach(item => {
      const itemData = [
        item.name,
        `₹${item.price}`, // Changed to Rupee symbol
        item.quantity,
        `₹${item.price * item.quantity}` // Changed to Rupee symbol
      ];
      tableRows.push(itemData);
    });

    doc.autoTable({ head: [tableColumn], body: tableRows, startY: 60 });

    // Add total amount
    doc.setFontSize(14);
    doc.text(`Total Amount: ₹${totalAmount}`, 14, doc.autoTable.previous.finalY + 10);

    // Add border
    doc.setLineWidth(0.5);
    doc.rect(10, 10, 190, doc.autoTable.previous.finalY + 20);

    doc.save('invoice.pdf');
  };

  // Generate UPI Payment QR Code
  const generateQRCode = () => {
    setShowQR(true);
  };

  return (
    <div className="invoice-container">
      <h2>Invoice</h2>
      {cart.length === 0 ? (
        <p>No items in the cart</p>
      ) : (
        <div>
          <div className="invoice-content">
            <h3>Velavan Super Stores</h3>
            <p>Phone: 9047665999</p>
            <p>Email: velavansuperstores@gmail.com</p>
            <p>GST No: 22AAXFV7324B1Z0</p>
            <p>Location: Bhavani main road, Salangapalayam, Tamil Nadu-638455</p>
            <hr />
            <ul>
              {cart.map((item, index) => (
                <li key={index}>
                  {item.name} - ₹{item.price} x {item.quantity} = ₹{item.price * item.quantity}
                </li>
              ))}
            </ul>
            <h3>Total Amount: ₹{totalAmount}</h3>
          </div>
          <button onClick={handleDownloadPDF}>Download PDF</button>
          <button onClick={generateQRCode} style={{ marginLeft: '10px' }}>Generate Payment</button>

          {/* Show QR Code when Generate Payment is clicked */}
          {showQR && (
            <div className="qr-container">
              <h3>Scan to Pay</h3>
              <QRCode
                value={`upi://pay?pa=sabarivasan1239@okhdfcbank&pn=Velavan%20Super%20Stores&mc=&tid=&tr=&tn=Payment%20for%20purchase&am=${totalAmount}&cu=INR`}
                size={200}
              />
              <p>UPI ID: sabarivasan1239@okhdfcbank</p>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default Invoice;
